import React from "react";
import Card from "./card";
import "./styles.css";

const cardStyling ={
    height: "calc(100vh - 4rem)",
    width:"100vw",
    maxWidth: "75rem",
    padding: "1rem 2rem",
    overflow: "hidden",
    margin: "0 auto",
    position: "relative",
    color: "white",
}
function Stuff() {
  return (
    <>
    
    <h2>About Me</h2>
    <div className="card-container" style={cardStyling}>
      <Card
        url="./projects.jpg"
        alt="Projects"
        alignment="left"
        key={1}
        name="My Projects"
      />
      <Card
        url="./blogs.jpg"
        alignment="right"
        key={2}
        name="My Blogs"
      />
    </div>
    </>
  );
}

export default Stuff;
